import React from 'react';

const RankTable = (rankList) => {
    let showList = []
    rankList.forEach((rank) => {
        let str = rank.username + " : " + rank.reactTime_Best
        showList.push(str)
    })
    return (
       <ol>
           {showList}
       </ol>
    )
};

export default RankTable
